import React from "react";
import { Link } from "react-router-dom";
import "./styles.css";

function Navbar() {
  return (
    <>
      <nav>
        <ul className="navbar-container">
          <li>
            <Link to="/">HOME</Link>
          </li>
          <li>
            <Link to="/login">LOGIN</Link>
          </li>
          <li>
            <Link to="/register">CADASTRO</Link>
          </li>
        </ul>
      </nav>
    </>
  );
}

export default Navbar;
